Dame [dame una] (дай мне) — dile que no с переходом к следующей партнёрше; Dame dos — dame с переходом ко второй партнёрше (через одну); Dame tres — dame с переходом к третьей партнёрше (через две);
Dame con una — dame с одним хлопком на счёт 7; Dame con dos — dame с двумя хлопками на счёт 7,8; Dame con tres — dame с тремя хлопками на счёт 7,8,1;
Vacílala [Vacila] — на 1,2,3 партнёр пускает в поворот партнёршу левой рукой от себя (через правое плечо партнёрши), партнёрша делает полоборота, на 5,6,7 она доворачивается до положения dile que no. далее собственно dile que no;
P’abajo (p’arriba) - Пабахо (паррива) (в обратную сторону) Exhibela - Эксибела (покажи её) Dile que no - Диле ке но Enchufla - Энчуфа Adios - Адиос, Prima - Прима
Enchufa doble - Энчуфа добле Vacila - Васила (посмотри на нее) Hola - Ола (Привет) Principe Bueno - Принсипе буэно (хороший принцип) Principe Malo - Принсипе мало (плохой принцип) Prima con hermana - Прима эрмана (прима с сестрой) Enchufa p’arriba - Энчуфа паррива Sobrero - Сомбреро El panque - Эль панке Setenta latino - Сетента латино (70) Setenta cubano - Сетента кубано Balsero - Бальсеро Foto - Фото Kentucky - Кетаки Noventa y cinco - Новента и синко (95) Setenta latino (complicado) - Сетента латино компликадо Setenta cubano (complicado) - Сетента кубано компликадо Paseala - Пасеала (прогулка)
